	const char* GetClassName(uint8_t classCode) {
		if (classCode == 0x40)
			return "Co-Processor";
		if (classCode == 0xFF)
			return "Unassigned Class";
		return DeviceClasses[classCode];
	}

	const char* MassStorageControllerSubclassName(uint8_t subclassCode) {
		switch (subclassCode){
			case 0x00:
				return "SCSI Bus Controller";
			case 0x01:
				return "IDE Controller";
			case 0x02:
				return "Floppy Disk Controller";
			case 0x03:
				return "IPI Bus Controller";
			case 0x04:
				return "RAID Controller";
			case 0x05:
				return "ATA Controller";
			case 0x06:
				return "Serial ATA";
			case 0x07:
				return "Serial Attached SCSI";
			case 0x08:
				return "Non-Volatile Memory Controller";
			case 0x80:
				return "Other";
			default:
				return to_hstring(subclassCode);
		}
	}

	const char* SerialBusControllerSubclassName(uint8_t subclassCode){
		switch (subclassCode){
			case 0x00:
				return "FireWire (IEEE 1394) Controller";
			case 0x01:
				return "ACCESS Bus";
			case 0x02:
				return "SSA";
			case 0x03:
				return "USB Controller";
			case 0x04:
				return "Fibre Channel";
			case 0x05:
				return "SMBus";
			case 0x06:
				return "Infiniband";
			case 0x07:
				return "IPMI Interface";
			case 0x08:
				return "SERCOS Interface (IEC 61491)";
			case 0x09:
				return "CANbus";
			case 0x80:
				return "SerialBusController - Other";
			default:
				return to_hstring(subclassCode);
		}
	}

	const char* BridgeDeviceSubclassName(uint8_t subclassCode){
		switch (subclassCode){
			case 0x00:
				return "Host Bridge";
			case 0x01:
				return "ISA Bridge";
			case 0x02:
				return "EISA Bridge";
			case 0x03:
				return "MCA Bridge";
			case 0x04:
				return "PCI-to-PCI Bridge";
			case 0x05:
				return "PCMCIA Bridge";
			case 0x06:
				return "NuBus Bridge";
			case 0x07:
				return "CardBus Bridge";
			case 0x08:
				return "RACEway Bridge";
			case 0x09:
				return "PCI-to-PCI Bridge";
			case 0x0a:
				return "InfiniBand-to-PCI Host Bridge";
			case 0x80:
				return "Other";
			default:
				return to_hstring(subclassCode);
		}
	}

	const char* GetSubclassName(uint8_t classCode, uint8_t subclassCode) {
		switch (classCode) {
			case 0x01: // mass storage controller
				return MassStorageControllerSubclassName(subclassCode);
			case 0x03:
				switch (subclassCode){
					case 0x00:
						return "VGA Compatible Controller";
					default:
						return to_hstring(subclassCode);
				}
			case 0x06:
				return BridgeDeviceSubclassName(subclassCode);
			case 0x0C:
				return SerialBusControllerSubclassName(subclassCode);
			default:
				return to_hstring(subclassCode);
		}
	}
	const char* GetProgIFName(uint8_t classCode, uint8_t subclassCode, uint8_t progIF) {
		uint32_t IF = (((classCode << 8) | subclassCode) << 8) | progIF;
		switch (IF) {
			case 0x010600:
				return "Vendor Specific Interface";
			case 0x010601:
				return "AHCI 1.0";
			case 0x010602:
				return "Serial Storage Bus";
			case 0x030000:
				return "VGA Controller";
			case 0x030001:
				return "8514-Compatible Controller";
			case 0x0C0300:
				return "UHCI Controller";
			case 0x0C0310:
				return "OHCI Controller";
			case 0x0C0320:
				return "EHCI (USB2) Controller";
			case 0x0C0330:
				return "XHCI (USB3) Controller";
			case 0x0C0380:
				return "Unspecified";
			case 0x0C03FE:
				return "USB Device (Not a Host Controller)";
			default:
				return to_hstring(progIF);
		}
	}
